const e=JSON.parse('{"key":"v-7b1f8f33","path":"/note/golang/open-source-books/The-Design-and-Implementation-of-Golang/03.3.html","title":"3.3 Golang 哈希表实现原理","lang":"zh-CN","frontmatter":{"title":"3.3 Golang 哈希表实现原理","date":"2022-03-29T00:00:00.000Z","category":["golang"],"tag":["slice"],"timeline":true},"headers":[{"level":2,"title":"3.3.1 设计原理","slug":"_3-3-1-设计原理","link":"#_3-3-1-设计原理","children":[{"level":3,"title":"哈希函数","slug":"哈希函数","link":"#哈希函数","children":[]},{"level":3,"title":"解决哈希冲突","slug":"解决哈希冲突","link":"#解决哈希冲突","children":[]}]},{"level":2,"title":"3.3.2 数据结构","slug":"_3-3-2-数据结构","link":"#_3-3-2-数据结构","children":[]},{"level":2,"title":"3.3.3 初始化","slug":"_3-3-3-初始化","link":"#_3-3-3-初始化","children":[{"level":3,"title":"字面量","slug":"字面量","link":"#字面量","children":[]},{"level":3,"title":"运行时","slug":"运行时","link":"#运行时","children":[]}]},{"level":2,"title":"3.3.4 读写操作","slug":"_3-3-4-读写操作","link":"#_3-3-4-读写操作","children":[{"level":3,"title":"访问","slug":"访问","link":"#访问","children":[]},{"level":3,"title":"写入","slug":"写入","link":"#写入","children":[]},{"level":3,"title":"扩容","slug":"扩容","link":"#扩容","children":[]},{"level":3,"title":"删除","slug":"删除","link":"#删除","children":[]}]},{"level":2,"title":"3.3.5 小结","slug":"_3-3-5-小结","link":"#_3-3-5-小结","children":[]},{"level":2,"title":"3.3.6 延伸阅读","slug":"_3-3-6-延伸阅读","link":"#_3-3-6-延伸阅读","children":[]},{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"git":{"updatedTime":1682725586000},"readingTime":{"minutes":20.15,"words":6044},"filePathRelative":"note/golang/open-source-books/The-Design-and-Implementation-of-Golang/03.3.md","localizedDate":"2022年3月29日","excerpt":"<h2> 3.3.1 设计原理</h2>\\n<p>哈希表是计算机科学中的最重要数据结构之一，不仅因其 <em>O(1)</em> 的读写性能优秀，还因为它提供了键值之间的映射。</p>\\n<p>要想实现一个性能优异的哈希表，需要注意两个关键点 -- <strong>哈希函数</strong>和<strong>哈希冲突</strong>的解决方法。</p>\\n<h3> 哈希函数</h3>\\n<p>实现哈希表的关键点在于哈希函数的选择，哈希函数的选择在很大程度上能够决定哈希表的读写性能。在理想的情况下哈希函数能够将不同键映射到不容的索引上，这要求哈希函数的<strong>输出范围大于输入范围</strong>，但是由于键的数量远远大于映射的范围，所以在实际使用中，理想的效果是无法实现的。</p>"}');export{e as data};
